  return (
    <div className='container'>
     <div className='filter'>
     Inpu
     </div>
      {
        props.jsonData.map((data, idx) => {
       
          return(
            
            <div className="subContainer">
            <h3>{data.rname}</h3>
            <p>Rating : &nbsp{data.rating} </p>
            <div className="btns">
          
            </div>
          </div>)
        })
      }
    </div>
  )
}

export default main
